import React, { useState } from "react";
import { useAuth } from "../AuthProvider";
import Navbar from "../components/NavBar";
import '../styles/Registers.css';

const RegisterUsuario = () => {
    const [usuario, setUsuario] = useState({
        cedula: "",
        nombre: "",
        apellidos: "",
        direccion: "",
        barrio: "",
        correo: "",
        telefono: "",
        nombre_usuario: "",
        contrasena: "",
        id_tipo: ""
    });
    const [mensaje, setMensaje] = useState("");
    const auth = useAuth();

    const handleSubmitEvent = async (e) => {
        e.preventDefault();

        if (usuario.cedula.trim()!== "" && usuario.nombre.trim()!== "" && usuario.apellidos.trim()!== "" && usuario.direccion.trim()!== "" &&
             usuario.barrio.trim()!== "" && usuario.correo.trim()!== "" && usuario.telefono.trim()!== "" && usuario.nombre_usuario.trim()!== ""
            && usuario.contrasena.trim()!== "" && usuario.id_tipo.trim()!== "") {
                
            try {
                const response = await fetch("http://localhost:3000/usuario", {
                    method: "POST",
                    headers: {
                        "Content-Type": "application/json",
                        Authorization: `Bearer ${auth.token}`,
                    },
                    body: JSON.stringify(producto),
                });
                const data = await response.json();
                if (response.ok) {
                    setMensaje(data.message);
                    setProducto({
                        descripcion: "",
                        costo: "",
                        peso: "",
                        margen_ganancia: "",
                        cantidad: "",
                        id_categoria: "",
                        id_material: ""
                    });
                } else {
                    setMensaje(data.message || "Error al registrar el producto");
                }
            } catch (error) {
                console.error("Error al registrar el producto:", error.message);
                setMensaje("Error de conexiÃ³n");
            }
        } else {
            setMensaje("Todos los campos son obligatorios");
        }
    };

    const handleInput = (e) => {
        const { name, value } = e.target;
        setProducto((prev) => ({
            ...prev,
            [name]: value,
        }));
    };

    return (
        <div>
            <Navbar />
            <div className="backgroundRP">
                <div className="containerRM">
                    <h2>Registrar Producto</h2>
                    <form id="datos" onSubmit={handleSubmitEvent}>
                        <div className="form_controlRM">
                            <label htmlFor="descripcion">DescripciÃ³n:</label>
                            <input
                                type="text"
                                id="descripcion"
                                name="descripcion"
                                value={producto.descripcion}
                                onChange={handleInput}
                            />
                        </div>
                        <div className="form_controlRM">
                            <label htmlFor="costo">Costo:</label>
                            <input
                                type="number"
                                id="costo"
                                name="costo"
                                value={producto.costo}
                                onChange={handleInput}
                            />
                        </div>
                        <div className="form_controlRM">
                            <label htmlFor="peso">Peso:</label>
                            <input
                                type="number"
                                id="peso"
                                name="peso"
                                value={producto.peso}
                                onChange={handleInput}
                                step= "any"
                                min ="0"
                            />
                        </div>
                        <div className="form_controlRM">
                            <label htmlFor="margen_ganancia">Margen de Ganancia:</label>
                            <input
                                type="number"
                                id="margen_ganancia"
                                name="margen_ganancia"
                                value={producto.margen_ganancia}
                                onChange={handleInput}
                                step="any"
                                min ="0"
                            />
                        </div>
                        <div className="form_controlRM">
                            <label htmlFor="cantidad">Cantidad:</label>
                            <input
                                type="number"
                                id="cantidad"
                                name="cantidad"
                                value={producto.cantidad}
                                onChange={handleInput}
                            />
                        </div>
                        <div className="form_controlRM">
                            <label htmlFor="id_categoria">CategorÃ­a:</label>
                            <input
                                type="text"
                                id="id_categoria"
                                name="id_categoria"
                                value={producto.id_categoria}
                                onChange={handleInput}
                            />
                        </div>
                        <div className="form_controlRM">
                            <label htmlFor="id_material">Material:</label>
                            <input
                                type="text"
                                id="id_material"
                                name="id_material"
                                value={producto.id_material}
                                onChange={handleInput}
                            />
                        </div>
                        <button className="btn-submitRM">Registrar Producto</button>
                        <div id="mensaje">{mensaje}</div>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default RegisterUsuario;
